import React, { useState } from 'react';
import { FaCalendarAlt } from 'react-icons/fa';
import './Input.css';

const Input = ({ message, setMessage, sendMessage, scheduleTime, setScheduleTime }) => {
    const [isDatePickerOpen, setIsDatePickerOpen] = useState(false);

    const handleIconClick = () => {
        setIsDatePickerOpen(!isDatePickerOpen); // Toggle date picker visibility
    };

    const handleDateChange = (event) => {
        setScheduleTime(event.target.value);
        setIsDatePickerOpen(false); // Close date picker after selecting a date
    };

    const handleSubmit = (event) => {
        event.preventDefault();
        sendMessage(event, scheduleTime);
    };

    return (
        <form className='form' onSubmit={handleSubmit}>
            <input
                className='input'
                type='text'
                placeholder="Type a message..."
                value={message}
                onChange={(event) => setMessage(event.target.value)}
            />
            <button className='sendButton' type='submit'>Send</button>

            {/* Calendar Icon */}
            <div className='datePickerContainer' style={{ position: 'relative' }}>
                <FaCalendarAlt className='dateIcon' onClick={handleIconClick} />

                {/* Date Picker Dropdown */}
                {isDatePickerOpen && (
                    <div style={{
                        position: 'absolute',
                        top: '30px', // Adjust this value to control vertical spacing below the icon
                        left: '10px',
                        zIndex: '1000',
                        backgroundColor: 'white', // Background color to make it more visible
                        padding: '3px',
                        borderRadius: '4px',
                        boxShadow: '0px 4px 8px rgba(0, 0, 0, 0.2)'
                    }}>
                        <input
                            type='datetime-local'
                            className='dateInput'
                            value={scheduleTime}
                            onChange={handleDateChange}
                        />
                    </div>
                )}
            </div>
        </form>
    );
};

export default Input;
